uardian before manage users.','ব্যবহারকারীদের পরিচালনা করার আগে শিক্ষক, কর্মচারী, ছাত্র এবং অভিভাবক যোগ করুন।','Agregue Maestro, Empleado, Estudiante y Tutor antes de administrar usuarios.','يرجى إضافة المعلم والموظف والطالب والجارديان قبل إدارة المستخدمين.','उपयोगकर्ताओं को प्रबंधित करने से पहले कृपया शिक्षक, कर्मचारी, छात्र और संरक्षक जोड़ें।','براہ کرم صارفین کو منظم کرنے سے قبل استاد، ملازم، طالب علم اور گارڈین شامل کریں.','在管理用户之前，请添加教师，员工，学生和监护人。','ユーザーを管理する前に教師、従業員、学生、保護者を追加してください。','Por favor, adicione Professor, Empregado, Estudante e Encarregado antes de administrar usuários.','Перед тем, как управлять пользователями, добавьте Учителя, Работника, Студента и Хранителя.','Veuillez ajouter un enseignant, un employé','사용자를 관리하기 전에 교사, 직원, 학생 및 보호자를 추가하십시오.','Bitte fügen Sie Teacher, Employee, Student und Guardian hinzu, bevor Sie Benutzer verwalten.','Prima di gestire gli utenti, aggiungi Insegnante, Dipendente, Studente e Guardiano.','โปรดเพิ่ม Teacher, Employee, Student และ Guardian ก่อนที่จะจัดการผู้ใช้','Kérjük, add hozzá tanár, alkalmazott, tanuló és gondnok, mielőtt kezelné a felhasználókat.','Voeg docent, medewerker, student en bewaker toe voordat u gebruikers beheert.','Placere addere: Magister bone, Aliquam, antequam student et episcopum administrare users.','Tolong tambahkan Guru, Karyawan, Pelajar dan Wali sebelum mengelola pengguna.','Kullanıcıları yönetmeden önce lütfen Öğretmen, Çalışan, Öğrenci ve Koruyucuyu ekleyin.','Προσθέστε δάσκαλο, υπάλληλο, φοιτητή και φύλακα πριν διαχειριστείτε τους χρήστες.','قبل از مدیریت کاربران، لطفا معلم، کارمند، دانشجو و نگهبان را اضافه کنید.','Sila tambah Guru, Pekerja, Pelajar dan Penjaga sebelum mengurus pengguna.','దయచేసి వినియోగదారులను నిర్వహించడానికి ముందు Teacher, ఉద్యోగి, స్టూడెంట్ మరియు గార్డియన్లను జోడించండి.','பயனர்களை நிர்வகிக்க முன் ஆசிரியர், பணியாளர், மாணவர் மற்றும் கார்டியன் ஆகியோரைச் சேர்க்கவும்.','વપરાશકર્તાઓ મેનેજ કરો તે પહેલાં શિક્ષક, કર્મચારી, વિદ્યાર્થી અને વાલીઓ ઉમેરો.','Przed zarządzaniem użytkownikami dodaj Nauczyciela, Pracownika, Studenta i Opiekuna.','До того, як керувати користувачами, додайте ','ਉਪਭੋਗਤਾਵਾਂ ਨੂੰ ਪ੍ਰਬੰਧਿਤ ਕਰਨ ਤੋਂ ਪਹਿਲਾਂ ਅਧਿਆਪਕ, ਕਰਮਚਾਰੀ, ਵਿਦਿਆਰਥੀ ਅਤੇ ਗਾਰਡੀਅਨ ਜੋੜੋ','Adăugați profesor, angajat, student și gardian înainte de a administra utilizatorii.','အရှင်ဘုရား, ထမ်း, ကျောင်းသားနှင့်ဂါးဒီးယန်းမတိုင်မီအသုံးပြုသူများကိုစီမံခန့်ခွဲ add ပေးပါ။','Jọwọ fi Olukọ, Olukọni, Akeko ati Olutọju ṣaju Ṣakoso awọn olumulo.','Da fatan a ƙara malami, maaikaci, dalibi da kuma tsare kafin gudanar da masu amfani.'),(413,'add_employee_instruction','Please add Designation before add Employee.','কর্মচারী যোগ করার আগে অনুগ্রহপূর্বক পদবী যোগ করুন','Agregue Designación antes de agregar Empleado.','يرجى إضافة تعيين قبل إضافة موظف.','कृपया कर्मचारी जोड़ें जोड़ने से पहले पदनाम जोड़ें।','ملازمت کو شامل کرنے سے قبل عہدہ شامل کریں.','请在添加员工之前添加指定。','従業員を追加する前に指定を追加してください。','Por favor, adicione Designação antes de adicionar Empregado.','Пожалуйста, добавьте Обозначение, прежде чем добавить Сотрудника.','Veuillez ajouter la désignation avant dajouter un employé.','Employee를 추가하기 전에 지정을 추가하십시오.','Bitte fügen Sie die Bezeichnung hinzu, bevor Sie Mitarbeiter hinzufügen.','Aggiungi la designazione prima di aggiungere un dipendente.','โปรดเพิ่มการกำหนดก่อนเพิ่ม Employee','Kérjük, add hozzá a jelölést, mielőtt hozzáadja a Munkavállalót.','Voeg een aanwijzing toe voordat u werknemer toevoegt.','Aliquam VOCABULUM addere placet in conspectu add.','Harap tambahkan Penunjukan sebelum menambahkan Karyawan.','Lütfen Çalışan eklemeden önce Adlandırma ekleyin.','Προσθέστε Προσδιορισμός πριν προσθέσετε Υπάλληλο.','قبل از افزودن کارمند لطفا نامگذاری را اضافه کنید.','Sila tambah Jawatan sebelum menambah Pekerja.','ఉద్యోగిని చేర్చడానికి ముందు హోదాను జత చేయండి.','பணியாளரை சேர்க்க முன் நியமனத்தைச் சேர்க்கவும்.','એમ્પ્લોયી ઉમેરો પહેલાં કૃપા કરીને હોદ્દો ઉમેરો.','Dodaj Oznaczenie przed dodaniem pracownika.','Будь ласка, додайте позначення, перш ніж додати співробітника.','ਕਰਮਚਾਰੀ ਨੂੰ ਸ਼ਾਮਲ ਕਰਨ ਤੋਂ ਪਹਿਲਾਂ ਕਿਰਪਾ ਕਰਕੇ ਪ੍ਰਸ਼ੰਸਾ ਸ਼ਾਮਲ ਕਰੋ','Adăugați o denumire înainte de a adăuga un angajat.','သတ်မှတ်ပေးထားခြင်းမတိုင်မီန်ထမ်းပေါင်းထည့်ပေါင်းထည့်ပေးပါ။','Jowo fi Ami silẹ ṣaaju ki o to fi Abáni ṣiṣẹ.','Da fatan a kara Zabin kafin ƙara maaikaci.'),(414,'add_class_instruction','Please add Teacher before add Class.','ক্লাস যোগ করার আগে শিক্ষক যোগ করুন','Por favor agregue Maestro antes de agregar Clase.','الرجاء إضافة معلم قبل إضافة الفصل الدراسي.','कृपया कक्षा जोड़ें से पहले शिक्षक जोड़ें।','کلاس شامل کرنے سے قبل ٹیچر شامل کریں.','请在添加课程之前添加教师','クラスを追加する前に教師を追加してください。','Adicione o professor antes de adicionar a classe.','Пожалуйста, добавьте Учителя перед добавлением класса.','Veuillez ajouter un enseignant avant dajouter une classe.','수업을 추가하기 전에 선생님을 추가하십시오.','Bitte fügen Sie den Lehrer hinzu, bevor Sie die Klasse hinzufügen.','Aggiungi linsegnante prima di aggiungere la lezione.','โปรดเพิ่มครูก่อนเพิ่มระดับ','Add hozzá a Tanárt, mielőtt hozzáadná az osztályt.','Voeg docent toe voordat u lesgroep toevoegt.','Magister add addere placet in conspectu Ps.','Tolong tambahkan Guru sebelum menambahkan Kelas.','Sınıfı eklemeden önce lütfen Öğretmen ekleyin.','Παρακαλούμε προσθέστε Δάσκαλο πριν προσθέσετε την κατηγορία.','قبل از افزودن کلاس، لطفا معلم را اضافه کنید.','Sila tambahkan Guru sebelum menambah Kelas.','క్లాస్ ను జోడించుటకు ముందుగా టీచర్ని చేర్చుము.','வர்க்கம் சேர்க்க முன் ஆசிரியர் சேர்க்க.','ઍડ ક્લાસ પહેલાં શિક્ષક ઉમેરો.','Dodaj Nauczyciela przed dodaniem klasy.','Будь ласка, додайте Учителя перед додаванням Класу.','ਕਿਰਪਾ ਕਰਕੇ ਐਡ ਕਲਾਸ ਤੋਂ ਪਹਿਲਾਂ ਅਧਿਆਪਕ ਸ਼ਾਮਲ ਕਰੋ.','Adăugați profesor înainte de a adăuga Clasa.','Class ကို add မတိုင်မီဆရာ add ပေးပါ။','Jọwọ fi Olukọ ṣaaju ki o to fi Kilasi sii.','Da fatan a kara Malam kafin ƙara Class.'),(427,'add_section_instruction','Please add Teacher & Class before add Section.','বিভাগ যোগ করার আগে শিক্ষক ও শ্রেণী যোগ করুন','Por favor agregue Maestro y Clase antes de agregar la Sección.','يرجى إضافة معلم وفئة قبل إضافة قسم.','अनुभाग जोड़ने से पहले शिक्षक और कक्षा जोड़ें','سیکشن میں شامل کرنے سے قبل ٹیچر اور کلاس شامل کریں.','在添加部分之前，请添加教师和班级。','セクションを追加する前に教師とクラスを追加してください。','Por favor, adicione professor e classe antes de adicionar seção.','Пожалуйста, добавьте Teacher & Class перед добавлением раздела.','Veuillez ajouter lenseignant et la classe avant dajouter la section.','섹션을 추가하기 전에 교사와 수업을 추가하십시오.','Bitte fügen Sie Lehrer und Klasse hinzu, bevor Sie Abschnitt hinzufügen.','Aggiungi insegnante e classe prima di aggiungere la sezione.','โปรดเพิ่ม Teacher & Class ก่อนเพิ่มส่วน','Add add Teacher & Class hozzáadása előtt szekció.','Voeg docent en klas toe voordat u sectie toevoegt.','Genus: Magister add & sectionem addere velit ante.','Tolong tambahkan Guru & Kelas sebelum menambahkan Bagian.','Bölüm eklemeden önce lütfen Öğretmen ve Sınıf ekleyin.','Παρακαλούμε προσθέστε το δάσκαλο και την τάξη πριν προσθέσετε ενότητα.','لطفا قبل از افزودن بخش معلم و کلاس اضافه کنید','Sila tambah Guru & Kelas sebelum menambah Seksyen.','దయచేసి విభాగాన్ని జోడించే ముందు Teacher & Class జోడించండి.','பிரிவு சேர்வதற்கு முன்னர் ஆசிரியர் மற்றும் வகுப்பைச் சேர்க்கவும்.','વિભાગ ઉમેરો પહેલાં શિક્ષક અને વર્ગ ઉમેરો.','Dodaj nauczyciela i zajęcia, zanim dodasz sekcję.','Додайте розділ ','ਕਿਰਪਾ ਕਰਕੇ ਸੈਕਸ਼ਨ ਜੋੜਨ ਤੋਂ ਪਹਿਲਾਂ ਅਧਿਆਪਕ ਅਤੇ ਕਲਾਸ ਸ਼ਾਮਲ ਕਰੋ.','Vă rugăm să adăugați un profesor și o clasă înainte de a adăuga secțiunea.','add ပုဒ်မမတိုင်မီအရှင်ဘုရား & Class ကို add ပေးပါ။','Jọwọ fi Olukọ ati Kilasi ṣaaju ki o to fi Abala kan kun.','Da fatan a ƙara Malami da Class kafin ƙara Sashe.'),(428,'class_add_alert','Please add Class','ক্লাস যোগ করুন','Por favor agrega Clase','يرجى إضافة فئة','कृपया कक्षा जोड़ें','براہ مہربانی کلاس شامل کریں','请添加Class','クラスを追加してください','Por favor, adicione Classe','Пожалуйста, добавьте класс','Veuillez ajouter une classe','수업을 추가하십시오.','Bitte fügen Sie Klasse hinzu','Per favore aggiungi Class','โปรดเพิ่ม Class','Add osztály','Voeg alstublieft Klasse toe','Placere addere Paleonemertea Class','Tolong tambahkan Kelas','Lütfen Sınıf ekle','Προσθέστε την κλάση','لطفا کلاس را اضافه کنید','Sila tambah Kelas','దయచేసి క్లాస్ను జోడించు','வகுப்பு சேர்க்கவும்','કૃપા કરીને વર્ગ ઉમેરો','Dodaj klasę','Будь ласка, додайте клас','ਕਲਾਸ ਸ਼ਾਮਿਲ ਕਰੋ ਜੀ','Adăugați Clasa','Class ကို add ပေးပါ','Jọwọ fi Kilasi sii','Da fatan a kara Class'),(429,'add_student_instruction','Please add Guardian, Class & Section before add Student.','ছাত্র যোগ করার আগে অভিভাবক, ক্লাস এবং বিভাগ যোগ করুন','Agregue Guardián, Clase y Sección antes de agregar Estudiante.','يرجى إضافة الجارديان، فئة وقسم قبل إضافة طالب.','कृपया छात्र जोड़ने से पहले अभिभावक, कक्षा और अनुभाग जोड़ें।','برائے مہربانی طالب علم کو شامل کرنے سے پہلے گارڈین، کلاس اور سیکشن شامل کریں.','添加学生前请添加监护人，课程和科室。','生徒を追加する前にGuardian、Class＆Sectionを追加してください。','Por favor, adicione Guardian, Class & Section antes de adicionar Student.','Пожалуйста, добавьте Guardian, Class & Section перед добавлением Студента.','Veuillez ajouter Guardian, Class & Section avant dajouter Student.','학생을 추가하기 전에 Guardian, Class & Section을 추가하십시오.','Bitte fügen Sie Guardian, Class & Section hinzu, bevor Sie Student hinzufügen.','Aggiungi Guardian, Class & Section prima di aggiungere Student.','กรุณาเพิ่ม Guardian, Class & Section ก่อนเพิ่ม Student','Add hozzá Guardian, Class & Section hozzáadása előtt Add Student.','Voeg Guardian, Class & Section toe voordat je Student toevoegt.','Adde sis custos, adde prius Discipulus Class sect.','Tolong tambahkan Guardian, Class & Section sebelum menambahkan Student.','Öğrenci eklemeden önce lütfen Guardian, Class & Sectionu ekleyin.','Παρακαλούμε προσθέστε Guardian, Class & Section πριν προσθέσετε Student.','قبل از افزودن دانش آموز، لطفا Guardian، Class & Section را اضافه کنید.','Sila tambah Guardian, Kelas & Seksyen sebelum menambah Pelajar.','దయచేసి విద్యార్థిని జోడించే ముందు గార్డియన్, క్లాస్ & సెక్షన్ని జోడించండి.','மாணவர் சேர்க்கும் முன்பு கார்டியன், வகுப்பு & பகுதி சேர்க்கவும்.','ઉમેરો વિદ્યાર્થી પહેલાં ગાર્ડિયન, વર્ગ અને વિભાગ ઉમેરો.','Przed dodaniem ucznia dodaj opiekuna, klasę i sekcję.','Перш ніж додати Студент, додайте Guardian, Class & Section.','ਕਿਰਪਾ ਕਰਕੇ ਵਿਦਿਆਰਥੀ ਸ਼ਾਮਲ ਕਰਨ ਤੋਂ ਪਹਿਲਾਂ ਗਾਰਡੀਅਨ, ਕਲਾਸ ਅਤੇ ਸੈਕਸ਼ਨ ਸ਼ਾਮਿਲ ਕਰੋ.','Vă rugăm să adăugați Guardian, Class & Section înainte de a adăuga Student.','ဂါးဒီးယန်း, အတန်းအစား & ပုဒ်မမတိုင်မီကျောင်းသား add add ပေးပါ။','Jowo fi Olutọju, Kilasi & Abala šaaju ki o to fi ọmọ-iwe kun.','Da fatan a kara Guardian, Class & Sashe kafin ƙara Student.'),(430,'add_assignment_instruction','Please add Class & Subject before add Assignment.','যোগদান যোগ করার আগে ক্লাস এবং বিষয় যোগ করুন','Agregue Clase y Asunto antes de agregar Asignación.','الرجاء إضافة الفئة والموضوع قبل إضافة التعيين.','कृपया असाइनमेंट जोड़ने से पहले कक्षा और विषय जोड़ें।','تفویض شامل کرنے سے پہلے کلاس اور مضمون شامل کریں.','请在添加作业之前添加课程和主题。','割り当てを追加する前にクラスと件名を追加してください。','Por favor, adicione Class & Subject antes de adicionar Atribuição.','Пожалуйста, добавьте Class & Subject перед добавлением Assignment.','Veuillez ajouter la classe et le sujet avant dajouter une affectation.','과제를 추가하기 전에 수업 및 과제를 추가하십시오.','Bitte fügen Sie Klasse und Betreff hinzu, bevor Sie die Zuweisung hinzufügen.','Per favore aggiungi Class & Subject prima di aggiungere Assignment.','โปรดเพิ่ม Class & Subject ก่อนที่จะเพิ่ม Assignment','Add hozzá az Osztályt és a témát, mielőtt hozzárendelheti.','Voeg Klasse en Onderwerp toe voordat u Toewijzing toevoegt.','Class placet, adde prius adsignatione add.','Harap tambahkan Kelas & Subjek sebelum menambahkan Penugasan.','Ödev eklemek için lütfen Sınıf ve Konuyu ekleyin.','Προσθέστε την κλάση και το θέμα πριν προσθέσετε την επιλογή Αντιστοίχιση.','لطفا کلاس و موضوع را قبل از اضافه شدن اضافه کنید.','Sila tambah Kelas & Subjek sebelum menambah Tugasan.','దయచేసి అసైన్మెంట్ను జోడించే ముందు క్లాస్ & సబ్జెక్ట్ జోడించండి.','ஒதுக்கீட்டைச் சேர்க்கும் முன்பு வகுப்பு & தலைப்பு சேர்க்கவும்.','મહેરબાની કરીને ઉમેરતા પહેલા સભા અને વિષય ઉમેરો.','Przed dodaniem zadania dodaj klasę i temat.','Будь ласка, додайте клас і тему, перш ніж додати асигнування.','ਕਿਰਪਾ ਕਰਕੇ ਅਸਾਈਨਮੈਂਟ ਤੋਂ ਪਹਿਲਾਂ ਕਲਾਸ ਅਤੇ ਵਿਸ਼ਾ ਜੋੜੋ.','Adăugați Clasă și Subiect înainte de a adăuga Atribuire.','add တာဝန်မတိုင်မီအတန်းအစား & အကြောင်းအရာ add ပေးပါ။','Jọwọ fi Kilasi & Koko ṣaaju ki o to fi iṣẹ-ṣiṣe kun.','Da fatan a kara Class & Rubutun kafin ƙara Matsayi.'),(431,'add_exam_schedule_instruction','Please add Exam, Class & Subject before add Exm Schedule.','পরীক্ষার সময়সূচী যোগ করার আগে পরীক্ষা, শ্রেণী ও বস্তু যুক্ত করুন।','Agregue Examen, Clase y Objeto antes de agregar el Horario del Examen.','الرجاء إضافة امتحان، فئة & كائن قبل إضافة جدول الامتحان.','परीक्षा परीक्षा अनुसूची जोड़ें से पहले परीक्षा, कक्षा और वस्तु जोड़ें','امتحان شیڈول میں شامل کرنے سے پہلے، امتحان، کلاس اور آبجیکٹ شامل کریں.','在添加考试时间表之前，请添加考试，课程和对象。','Exam Scheduleを追加する前に、Exam、Class＆Objectを追加してください。','Por favor, adicione o Exame, Classe e Objeto antes de adicionar o Programa de Exames.','Пожалуйста, добавьте Экзамен, Класс и Объект, прежде чем добавить График экзамена.','Veuillez ajouter lexamen, la classe et lobjet avant dajouter lhoraire dexamen.','Exam Schedule을 추가하기 전에 Exam, Class & Object를 추가하십시오.','Bitte fügen Sie Prüfung, Klasse und Objekt hinzu, bevor Sie den Prüfungsplan hinzufügen.','Aggiungi esame, classe e oggetto prima di aggiungere la pianificazione degli esami.','โปรดเพิ่มการสอบวิชา & วัตถุก่อนเพิ่มตารางการสอบ','Add Exam, Class & Object hozzáadása az Exam Schedule hozzáadásához.','Voeg Examen, Klasse & Object toe voordat u het Exam Schedule toevoegt.','Placere addere IV, addere IV Class Object coram arcu.','Harap tambahkan Ujian, Kelas & Objek sebelum menambahkan Jadwal Ujian.','Sınav Takvimi eklemeden önce lütfen Sınav, Sınıf ve Nesneyi ekleyin.','Παρακαλούμε προσθέστε Εξετάσεις, Τάξη & Αντικείμενο πριν προσθέσετε το Πρόγραμμα Εξετάσεων.','قبل از افزودن برنامه آزمون، لطفا امتحان، کلاس و شیء را اضافه کنید.','Sila tambah Peperiksaan, Kelas & Objek sebelum menambah Jadual Peperiksaan.','పరీక్షా షెడ్యూల్ను జోడించే ముందు పరీక్ష, క్లాస్ & ఆబ్జెక్ట్ చేర్చండి.','தேர்வு அட்டவணை சேர்க்க முன் முன், வகுப்பு & பொருள் சேர்க்க தயவு செய்து.','પરીક્ષા શેડ્યૂલ ઉમેરો પહેલાં પરીક્ષાની, વર્ગ અને ઑબ્જેક્ટ ઉમેરો','Dodaj egzamin, klasę i obiekt przed dodaniem harmonogramu egzaminu.','Додайте іспит, клас і обєкт перед додаванням графіка іспиту.','ਕਿਰਪਾ ਕਰਕੇ ਪ੍ਰੀਖਿਆ ਸ਼ਡਿਊਲ ਸ਼ਾਮਲ ਕਰਨ ਤੋਂ ਪਹਿਲਾਂ ਪ੍ਰੀਖਿਆ, ਕਲਾਸ ਅਤੇ ਔਬਜੈਕਟ ਸ਼ਾਮਲ ਕਰੋ.','Adăugați examen, clasă și obiect înainte de a adăuga programul de examinare.','အတန်းအစား & အရာဝတ္ထုမတိုင်မီစာမေးပွဲအချိန်ဇယားကိုထည့်သွင်း, စာမေးပွဲ add ပေးပါ။','Jọwọ fi kẹhìn, Kilasi & Ohun ṣaaju ki o to ṣayẹwo Akẹkọ Idaduro.','Da fatan a kara gwadawa, Class & Object kafin ƙara Nazarin Jarrabawa.'),(432,'add_exam_suggestion_instruction','Please add Exam, Class & Subject before add Exam Suggestion.','পরীক্ষা পরামর্শ যোগ করার আগে পরীক্ষা, শ্রেণী এবং বিষয় যুক্ত করুন।','Agregue Examen, Clase y Asunto antes de agregar Exm Sugerencia.','يرجى إضافة امتحان، فئة & الموضوع قبل إضافة اقتراح إكسم.','Exm सुझाव जोड़ने से पहले परीक्षा, कक्षा और विषय जोड़ें।','اے ایم ایم تجاویز کو شامل کرنے سے قبل امتحان، کلاس اور مضمون شامل کریں.','在添加Exm建议之前，请添加考试，课程和主题。','Exm提案を追加する前に、Exam、Class＆Subjectを追加してください。','Por favor, adicione Exame, Classe e Assunto antes de adicionar Exm Sugestão.','Пожалуйста, добавьте Экзамен, Класс и Тема, прежде чем добавить предложение Exm.','Sil vous plaît ajouter lexamen, la classe et le sujet avant dajouter la suggestion dExm.','Exm 제안을 추가하기 전에 Exam, Class & Subject를 추가하십시오.','Bitte fügen Sie Exam, Class & Subject hinzu, bevor Sie Exm Suggestion hinzufügen.','Aggiungi Exam, Class e Subject prima di aggiungere Exm Suggestion.','โปรดเพิ่มการสอบวิชา & หัวเรื่องก่อนเพิ่มคำแนะนำ Exm','Add Exam, Class & Subject hozzáadása az Exm Suggestion hozzáadásához','Voeg examen, klasse en onderwerp toe voordat u Exm-suggestie toevoegt.','IV addere placet, adde prius Class Exm Suggestion.','Harap tambahkan Ujian, Kelas & Subjek sebelum menambahkan Sa