 setting ပါ။','Jọwọ ṣe eto eto ẹkọ.','Don Allah a kafa shekara ta ilimi.'),(622,'add_routine_instruction','Must be good combination (between room, time, teacher, day & subject) for routine.','রুটিনের জন্য ভালো সমন্বয় (রুম, সময়, শিক্ষক, দিন এবং বিষয় মধ্যে) হতে হবে।','Debe ser una buena combinación (entre la habitación, el tiempo, el maestro, el día y el tema) para la rutina.','يجب أن تكون تركيبة جيدة (بين الغرفة والوقت والمعلم واليوم والموضوع) للروتين.','दिनचर्या के लिए अच्छे संयोजन (कमरे, समय, शिक्षक, दिन और विषय के बीच) होना चाहिए।','معمول کے لئے اچھا مجموعہ (کمرے، وقت، استاد، دن اور موضوع کے درمیان) ہونا ضروری ہے.','必须是常规的良好组合（房间，时间，老师，日期和主题）。','ルーチンのためには、（部屋、時間、教師、日、テーマの間の）良い組み合わせでなければなりません。','Deve ser uma boa combinação (entre sala, tempo, professor, dia e assunto) para a rotina.','Должна быть хорошая комбинация (между комнатой, временем, учителем, днем и субъектом) для рутины.','Doit être une bonne combinaison (entre la pièce, lheure, lenseignant, le jour et le sujet) pour la routine.','평소에는 (방, 시간, 선생님, 낮 과목 사이에) 좋은 조합이어야합니다.','Muss eine gute Kombination sein (zwischen Raum, Zeit, Lehrer, Tag und Thema) für die Routine.','Deve essere una buona combinazione (tra stanza, orario, insegnante, giorno e materia) per la routine.','ต้องเป็นชุดที่ดี (ระหว่างห้องเวลาครูวันและเรื่อง) เป็นประจำ','Jó kombinációnak kell lennie (helyiség, idő, tanár, nap és téma között) a rutinhoz.','Moet een goede combinatie zijn (tussen kamer, tijd, docent, dag en onderwerp) voor routine.','Bonum est combination (inter locus, tempus, magister, & re die), pro exercitatione.','Harus kombinasi yang baik (antara ruang, waktu, guru, hari & subjek) untuk rutinitas.','Rutin için iyi bir kombinasyon (oda, zaman, öğretmen, gün ve konu arasında) olmalı.','Πρέπει να είναι καλός συνδυασμός (μεταξύ δωματίου, χρόνου, καθηγητή, μέρα & θέμα) για ρουτίνα.','ترکیب مناسب (بین اتاق، زمان، معلم، روز و موضوع) باید به صورت منظم باشد.','Harus menjadi kombinasi yang baik (antara bilik, masa, guru, hari & mata pelajaran) untuk rutin.','రొటీన్ కోసం మంచి కలయిక (గది, సమయం, గురువు, రోజు & విషయం మధ్య) ఉండాలి.','வழக்கமான கலவையாக இருக்க வேண்டும் (அறைக்கு, நேரம், ஆசிரியர், நாள் & பொருள்).','નિત્યક્રમ માટે સારા સંયોજન (ખંડ, સમય, શિક્ષક, દિવસ અને વિષય વચ્ચે) હોવો જોઈએ.','Musi to być dobra kombinacja (między pokojem, czasem, nauczycielem, dniem i tematem) dla rutyny.','Повинно бути гарною комбінацією (між кімнатою, часом, вчителем, днем та предметом) для звичайної роботи.','ਰੁਟੀਨ ਲਈ ਵਧੀਆ ਮਿਸ਼ਰਨ ਹੋਣਾ (ਕਮਰੇ, ਸਮੇਂ, ਅਧਿਆਪਕ, ਦਿਨ ਅਤੇ ਵਿਸ਼ੇ ਵਿਚਕਾਰ).','Trebuie să fie o combinație bună (între cameră, timp, profesor, zi și subiect) pentru rutină.','လုပ်ရိုးလုပ်စဉ်အဘို့ (အခန်းတစ်ခန်းအကြား, အချိန်, ဆရာ, နေ့ & ဘာသာရပ်) ကောင်းသောပေါင်းစပ်ဖြစ်ရမည်။','Gbọdọ jẹ apapo ti o dara (laarin yara, akoko, olukọ, ọjọ & akori) fun iṣiro.','Dole ne ya kasance haɗin hade (tsakanin ɗaki, lokaci, malami, rana da batun) don na yau da kullum.'),(623,'exam_attendance_instruction','Please create exam schedule for this Exam, Class, Section & Subject.','এই পরীক্ষা, ক্লাস, সেকশন ও বিষয়ের জন্য পরীক্ষার সময়সূচী তৈরি করুন।','Por favor, cree un cronograma de exámenes para este examen, clase, sección y tema.','يرجى إنشاء جدول الامتحانات لهذا الامتحان، فئة، قسم والموضوع.','कृपया इस परीक्षा, कक्षा, धारा और विषय के लिए परीक्षा कार्यक्रम बनाएं।','برائے مہربانی اس امتحان، کلاس، سیکشن اور موضوع کیلئے امتحان شیڈول بنائیں.','请为此考试，班级，科目和科目创建考试时间表。','この試験、クラス、セクション＆サブジェクトの試験スケジュールを作成してください。','Crie um cronograma de exame para este Exame, Classe, Seção e Assunto.','Создайте расписание экзаменов для этого экзамена, класса, раздела и темы.','Veuillez créer un horaire dexamen pour cet examen, classe, section et sujet.','이 시험, 클래스, 섹션 및 제목에 대한 시험 일정을 작성하십시오.','Bitte erstellen Sie einen Prüfungsplan für diese Prüfung, Klasse, Abschnitt und Thema.','Si prega di creare un programma desame per questo esame, classe, sezione e argomento.','โปรดสร้างกำหนดการสอบสำหรับการสอบวิชา Class, Section & Subject','Kérjük, hozzon létre vizsgaütemezést ehhez a vizsgahoz, osztályhoz, szekcióhoz és tárgyhoz.','Maak een examenrooster voor dit examen, de cursus, sectie en onderwerp.','Placere creare nito schedule hoc IV: I classis, & Art subiectum.','Tolong buat jadwal ujian untuk Ujian, Kelas, Seksi & Subjek ini.','Lütfen bu Sınav, Ders, Bölüm ve Konunun sınav takvimini oluşturun.','Δημιουργήστε το πρόγραμμα εξετάσεων για αυτήν την εξέταση, κλάση, ενότητα & θέμα.','لطفا برنامه آزمون برای این آزمون، کلاس، بخش و موضوع ایجاد کنید.','Sila buat jadual peperiksaan untuk Peperiksaan, Kelas, Bahagian & Subjek ini.','ఈ పరీక్ష, తరగతి, విభాగం & విషయం కోసం పరీక్ష షెడ్యూల్ సృష్టించండి.','இந்தப் பரீட்சை, வகுப்பு, பிரிவு மற்றும் பாடநெறிக்கான பரீட்சை அட்டவணையை உருவாக்கவும்.','આ પરીક્ષા, વર્ગ, વિભાગ અને વિષય માટે પરીક્ષા શેડ્યૂલ બનાવો.','Utwórz harmonogram egzaminów dla tego egzaminu, klasy, sekcji i przedmiotu.','Будь ласка, створіть графік іспитів для цього іспиту, класу, розділу та теми.','ਕਿਰਪਾ ਕਰਕੇ ਇਸ ਪ੍ਰੀਖਿਆ, ਕਲਾਸ, ਭਾਗ ਅਤੇ ਵਿਸ਼ੇ ਦੇ ਲਈ ਪ੍ਰੀਖਿਆ ਸ਼ਡਿਊਲ ਬਣਾਓ.','Vă rugăm să creați un program de examen pentru acest examen, clasă, secțiune și subiect.',', အတန်းအစား, ပုဒ်မ & အကြောင်းအရာကဒီစာမေးပွဲအဘို့အစာမေးပွဲအချိန်ဇယားကိုဖန်တီးပေးပါ။','Jowo ṣẹda iṣeto ayẹwo fun Akọwo yii, Kilasi, Abala & Koko.','Don Allah a halicci jimillar jarrabawar wannan jarrabawar, Class, Sashe & Sashe.'),(624,'exam_mark_instruction','Please ensure Exam Schedule and Exam Attendance before Exam Mark Entry.','পরীক্ষা মার্ক এণ্ট্রি আগে পরীক্ষার সময়সূচী এবং পরীক্ষা উপস্থিতি নিশ্চিত করুন।','Por favor asegúrese de Horario de Examen y Asistencia al Examen antes de la Entrada de la Marca de Examen.','يرجى التأكد من جدول الامتحانات وحضور الامتحان قبل دخول علامة الامتحان.','परीक्षा मार्क एंट्री से पहले परीक्षा अनुसूची और परीक्षा उपस्थिति सुनिश्चित करें।','امتحان مارک انٹری سے پہلے امتحان شیڈول اور امتحان حاضری کو یقینی بنائیں.','入学考试前，请确保考试时间表和考试出勤。','試験のマーク入力の前に試験スケジュールと試験出席を確認してください。','Por favor, assegure o horário de exame e a participação no exame antes da entrada na nota do exame.','Пожалуйста, убедитесь, что экзаменационные экзамены и экзамен посещаемости до сдачи экзамена Марк.','Veuillez vous assurer de respecter le calendrier des examens et la participation aux examens avant lentrée à lexamen.','시험 마크 입력 전에 시험 일정과 시험 출석을 확인하십시오.','Bitte stellen Sie sicher, dass der Prüfungsplan und die Anwesenheit der Prüfung vor der Eintragung der Prüfungsnote eingehalten werden.','Si prega di assicurare la pianificazione degli esami e la frequenza degli esami prima delliscrizione.','โปรดตรวจสอบตารางการสอบและการเข้าร่วมการสอบก่อนการสอบของ Mark Entry','Kérjük, győződjön meg arról, hogy az Exam Mark Entry és Exam Attendance Exam Mark Entry előtt van.','Zorg ervoor dat het examenrooster en het examen aanwezig zijn vóór de inzending van het examen.','Test Morbi rhoncus velit, ut et IV ante Attendance Mark Test Entry.','Harap pastikan Jadwal Ujian dan Ujian Kehadiran sebelum Entri Tanda Ujian.','Sınav işareti girmeden önce lütfen Sınav Takvimi ve Sınav Ekibinden emin olunuz.','Βεβαιωθείτε ότι έχετε προγραμματίσει τις εξετάσεις και την εξέταση πριν την εγγραφή.','لطفا قبل از امتحان علامت گذاری به عنوان خوانده شده تست برنامه آزمون و حضور در آزمون را تضمین کنید.','Sila pastikan Jadual Peperiksaan dan Kehadiran Peperiksaan sebelum Kemasukan Tanda Peperiksaan.','పరీక్షా పరీక్ష షెడ్యూల్ మరియు పరీక్షా హాజరు నిర్ధారించడానికి దయచేసి మార్క్ ఎంట్రీ పరీక్ష.','பரீட்சைக்கு முன் தேர்வுப் பரீட்சை மற்றும் பரீட்சை பெறுதல் ஆகியவற்றை உறுதிப்படுத்துக.','પરીક્ષા માર્ક એન્ટ્રી પહેલાં પરીક્ષાની સૂચિ અને પરીક્ષા હાજરી નક્કી કરો.','Należy upewnić się, że harmonogram egzaminów i udział w egzaminach poprzedzą wejście do egzaminu.','Будь ласка, вкажіть час іспиту і відвідуваність іспиту перед початком вступки до іспиту.','ਐਜੂਕੇਸ ਮਾਰਕ ਐਂਟਰੀ ਤੋਂ ਪਹਿਲਾਂ ਪ੍ਰੀਖਿਆ ਸ਼ਡਿਊਲ ਅਤੇ ਪ੍ਰੀਖਿਆ ਹਾਜ਼ਰੀ ਯਕੀਨੀ ਬਣਾਉ.','Asigurați-vă că ați verificat programul de examen și examenul înainte de înscrierea în examen.','စာမေးပွဲမာကု Entry မတိုင်မီစာမေးပွဲအချိန်ဇယားနှင့်စာမေးပွဲတက်ရောက်သေချာပါစေ။','Jọwọ ṣe idaniloju Akoko Idaduro ati Akokọ Ibẹwo ṣaaju titẹ Akọsilẹ Akọsilẹ.','Da fatan a tabbatar da Gwargwadon Binciken da Jarraba Tambaya kafin jarrabawar Mark Mark.'),(625,'mark_sheet_instruction','Please ensure Exam Attendance and Exam Mark to find Mark Sheet.','মার্ক শিট খুঁজে পেতে পরীক্ষার এ্যাটেনডেন্স এবং পরীক্ষা মার্ক নিশ্চিত করুন।','Asegúrate de que la Asistencia al examen y la Marca del examen encuentren la Hoja de calificaciones.','يرجى التأكد من امتحان الحضور وامتحان علامة لإيجاد علامة ورقة.','मार्क शीट को खोजने के लिए परीक्षा उपस्थिति और परीक्षा अंक को सुनिश्चित करें','براہ کرم مارک شیٹ کو تلاش کرنے کے لئے امتحان حاضری اور امتحان مارک کو یقینی بنائیں.','请确保考试出席和考试标志找到标记表。','マークシートを見つけるには、試験出席と試験マークを確認してください。','Certifique-se da presença do exame e da nota do exame para encontrar a folha de notas.','Пожалуйста, убедитесь, что экзамен посещаемости и экзамен Марк, чтобы найти Mark Sheet.','Veuillez vous assurer de la présence à lexamen et de la note dexamen pour trouver la feuille de notes.','마크 시트를 찾으려면 시험 출석과 시험 마크를 확인하십시오.','Bitte stellen Sie sicher, dass die Prüfungsteilnahme und die Prüfungsnote Mark-Sheet finden.','Si prega di assicurare la partecipazione agli esami e il marchio dellesame per trovare il foglio dei voti.','โปรดตรวจสอบว่ามีผู้เข้าสอบและเครื่องหมายสอบเพื่อหา Mark Sheet','Kérjük, hogy az Exam Attendance és a Exam Mark-ot találja meg a Mark Sheet-et.','Zorg ervoor dat u een examenformulier en een examencertificaat aantreft om het beoordelingsformulier te vinden.','Placere operam ad inveniendum Mark Mark Chapter OMNIBUS June IV Sheet.','Harap pastikan Ujian Kehadiran dan Tanda Ujian untuk menemukan Lembar Tandai.','Marka Belgesini bulmak için lütfen Sınav Devamını ve Sınav İşaretini sağlayın.','Βεβαιωθείτε ότι έχετε παρακολουθήσει την εξέταση και εξετάστε το για να βρείτε το φύλλο σημείωσης.','لطفا از بازدید کننده امتحان و علامت آزمون اطمینان حاصل کنید تا علامت ورق را پیدا کنید.','Sila pastikan Kehadiran Peperiksaan dan Ujian Peperiksaan untuk mencari Mark Sheet.','మార్క్ షీట్ను కనుగొనడానికి పరీక్షా హాజరు మరియు పరీక్షా మార్క్ ను నిర్ధారించుకోండి.','மார்க் தாள் கண்டுபிடிக்க தேர்ச்சி மற்றும் தேர்வு மார்க் உறுதி செய்யவும்.','માર્ક શીટ શોધવા માટે પરીક્ષાની હાજરી અને પરીક્ષા માર્ક કરો.','Prosimy o upewnienie się, że obecność na egzaminie i znak egzaminu jest zaznaczona.','Будь ласка, впевніться, що відвідувачі іспитів і екзаменаційні квитки знайдете листівки.','ਕਿਰਪਾ ਕਰਕੇ ਮਾਰਕ ਸ਼ੀਟ ਨੂੰ ਲੱਭਣ ਲਈ ਪ੍ਰੀਖਿਆ ਹਾਜ਼ਰੀ ਅਤੇ ਪ੍ਰੀਖਿਆ ਪੱਤਰ ਨੂੰ ਯਕੀਨੀ ਬਣਾਓ.','Asigurați-vă că ați participat la examen și la examen pentru a găsi o coală Mark.','မာကုစာရွက်ရှာတွေ့မှစာမေးပွဲတက်ရောက်ခြင်းနှင့်စာမေးပွဲမာကုသေချာပါစေ။','Jowo rii daju pe idaduro Ijadii ati Ṣayẹwo Marku lati wa Mark Sheet.','Da fatan a tabbatar da Hannun Binciken da Takaddun Mark don neman Mark Sheet.'),(626,'exam_result_instruction','Please ensure Exam Mark and Exam Attendance before Final Mark Entry.','চূড়ান্ত মার্ক এণ্ট্রি আগে পরীক্ষা মার্ক এবং পরীক্ষার উপস্থিতি নিশ্চিত করুন।','Por favor, asegúrese de la marca de examen y la asistencia al examen antes de la entrada de la marca final.','يرجى التأكد من امتحان علامة وامتحان الحضور قبل علامة النهائي الدخول.','अंतिम मार्क प्रविष्टि से पहले परीक्षा मार्क और परीक्षा उपस्थिति सुनिश्चित करें','فائن مارک انٹری سے پہلے امتحان کے نشان اور امتحان کی حاضری یقینی بنائیں.','请在最终标记输入前确保考试标志和考试出勤。','最終マーク記入前に試験マークと試験出席を確認してください。','Certifique-se de a nota do exme e da presença do exame antes da entrada na nota final.','Пожалуйста, убедитесь, что экзамен и участие в экзамене перед окончательной записью.','Sil vous plaît assurez-vous dexamen et de présence à lexamen avant lentrée de la note finale.','최종 점수 입력 전에 시험 점수와 시험 출석을 확인하십시오.','Bitte stellen Sie sicher, dass Sie die Prüfung und die Teilnahme an der Prüfung vor der endgültigen Noteneingabe erhalten.','Si prega di assicurare la certificazione degli esami e la partecipazione agli esami prima della registrazione del voto finale.','โปรดตรวจสอบให้แน่ใจว่ามีผู้เข้าร่วมการสอบและการสอบเข้าร่วมการแข่งขันก่อนเข้าร่วมการแข่งขัน Final Mark Entry','Kérjük, győződjön meg az Exam Mark és Exam Attendance előtt a végső belépési bejegyzést.','Zorg ervoor dat het examen en het examen aanwezig zijn vóór de definitieve inschrijving.','Mark quaeso ensure nito et Finalis nito apud Attendance Mark Entry.','Harap pastikan Tanda Ujian dan Ujian Kehadiran sebelum Entri Mark Akhir.','Nihai İşaret Girişinden önce lütfen Sınav İmzası ve Sınav Ekibinden emin olun.','Παρακαλείσθε να βεβαιωθείτε για την εξέταση και την εξέταση πριν την τελική εγγραφή.','لطفا قبل از ورود به نشریه نهایی علامت گذاری آزمون و حضور آزمون را تضمین کنید.','Sila pastikan Peperiksaan dan Kehadiran Peperiksaan sebelum Kemasukan Tanda Akhir.','ఫైనల్ మార్క్ ఎంట్రీకి ముందు పరీక్ష మార్క్ మరియు పరీక్షా హాజరును నిర్ధారించుకోండి.','இறுதியாண்டு மார்க் நுழைவுமுறையில் தேர்வுப் பரீட்சை மற்றும் தேர்வுப் பணிகளை உறுதி செய்யுங்கள்.','અંતિમ માર્ક એન્ટ્રી પહેલાં પરીક્ષા માર્ક અને પરીક્ષાની હાજરી નિશ્ચિત કરો.','Prosimy o upewnienie się, że Egzamin i Egzaminacja Egzaminu odbywają się przed Ostatecznym Wpisem.','Ознайомтеся з учасниками іспитів та учасниками іспитів перед початком вступного запису.','ਕਿਰਪਾ ਕਰਕੇ ਅੰਤਮ ਮਾਰਕ ਐਂਟਰੀ ਤੋਂ ਪਹਿਲਾਂ ਪ੍ਰੀਖਿਆ ਅੰਕ ਅਤੇ ਪ੍ਰੀਖਿਆ ਹਾਜ਼ਰੀ ਯਕੀਨੀ ਬਣਾਉ.','Asigurați-vă că examinați examenul și examenul înainte de înscrierea în marcajul final.','နောက်ဆုံးမာကု Entry မတိုင်မီစာမေးပွဲမာကုနဲ့စာမေးပွဲတက်ရောက်သေချာပါစေ။','Jọwọ ṣe idaniloju Atilẹkọ Akọsilẹ ati isinwo Iwoye ṣaaju Ṣiṣe Akọsilẹ Titẹ.','Da fatan a tabbatar da Takaddun Mark da Takaddama na Aiki kafin shigarwa na karshe.'),(627,'promotion_instruction_1','Please choose carefully Running Session & Promote Session.','দয়া করে সাবধানে চলমান সেশন  এবং প্রমোট সেশন নির্বাচন করুন।','Elija cuidadosamente Ejecutar sesión y promover sesión.','الرجاء اختيار بعناية تشغيل جلسة وتعزيز الدورة.','कृपया सावधानी से चल रहे सत्र और सत्र को बढ़ावा दें चुनें।','براہ کرم رننگ سیشن اور سیشن کو فروغ دینے کے لۓ منتخب کریں.','请谨慎选择运行会议和推广会议。','慎重に実行セッションとプロモートセッションを選択してください。','Por favor, escolha cuidadosamente a Sessão de Sessão e Promoção.','Пожалуйста, тщательно выберите «Запуск сеанса» и «Содействие».','Sil vous plaît choisir soigneusement session en cours et promouvoir la session.','신중하게 세션 및 프로모션 세션을 선택하십시오.','Bitte wählen Sie sorgfältig ','Si prega di scegliere attentamente Running Session & Promoting Session.','เลือกเซสชันและเซสชันส่งเสริมการขายอย่างรอบคอบ','Kérjük, gondosan válassza a Futtatás és a kampány előmozdítását.','Kies zorgvuldig Sessie uitvoeren en sessie promoten.','Placere eligere diligenter & Thronus Sessio Promovere Sessio.','Harap pilih Session & Promote Session dengan hati-hati.','Lütfen dikkatle Çalışmayı Seçin ve Oturumu Tanıtın.','Επιλέξτε προσεκτικά την εκτέλεση της συνόδου και την προώθηση της συνόδου.','لطفا با دقت در حال اجرا Session & Promote Session را انتخاب کنید.','Sila pilih Sesi Berjalan & Sesi Promosi dengan hati-hati.','దయచేసి సెషన్ రన్నింగ్ & ప్రచారం సెషన్ను జాగ్రత్తగా ఎంచుకోండి.','அமர்வு இயக்குதல் மற்றும் அமர்வு ஊக்குவிக்க கவனமாகத் தேர்ந்தெடுங்கள்.','કૃપા કરીને કાળજીપૂર્વક ચાલી રહેલ સત્ર અને પ્રમોશન સત્ર પસંદ કરો.','Proszę wybrać ostrożnie Running Session & Promote Session.','Будь ласка, обережно вибирайте запуск сеансу та просуньте сеанс.','ਕਿਰਪਾ ਕਰਕੇ ਧਿਆਨ ਨਾਲ ਚੱਲ ਰਹੇ ਸੈਸ਼ਨ ਨੂੰ ਚੁਣੋ ਅਤੇ ਸੈਸ਼ਨ ਨੂੰ ਪ੍ਰਮੋਟ ਕਰੋ.','Alegeți cu atenție Rularea sesiunii și promovarea sesiunii.','တွေ့ဆုံဆွေးနွေးပွဲ & တွေ့ဆုံဆွေးနွေးပွဲမြှင့်တင်ကို run ဂရုတစိုက်ရွေးချယ်ပါ။','Jowo yan Ṣeto Nilẹ Ikẹkọ ati Igbimọ Ikẹkọ.','Da fatan za a zaɓa a zahiri a Gudun Zama da Tsarin Zama.'),(628,'promotion_instruction_2','Please choose carefully Current Class & Promote to Class.','দয়া করে সাবধানে বর্তমান ক্লাস  এবং প্রমোট ক্লাস নির্বাচন করুন।','Por favor, elija con cuidado la Clase actual y Promocione a la clase.','يرجى اختيار بعناية الفئة الحالية والترقية إلى فئة.','कृपया ध्यान दें वर्तमान कक्षा और श्रेणी में प्रचार करें।','براہ کرم احتیاط سے موجودہ کلاس کا انتخاب کریں اور کلاس میں فروغ دیں.','请仔细选择当前课程并提升到课堂。','慎重に選択してください現在のクラスとクラ